#include<iostream>
#include<vector>
using namespace std;
/**
    doc:
    Sort a linked list in O(n*log(n)) time using constant space complexity

    148Sort List.cpp
*/
struct ListNode {
      int val;
      ListNode *next;
      ListNode(int x) : val(x), next(NULL) {}
 };

 void printList(ListNode* head){
    cout<<endl<<"-------------begin-----------------"<<endl;
    ListNode* rh = head;
    while(rh!=NULL){
        cout<<rh->val<<" ";
        rh = rh->next;
    }
    cout<<endl<<"-------------over------------------"<<endl;
}
ListNode* createNodeList(int* begin,int *end){
    ListNode* head = new ListNode(0);
    ListNode* p = head;
    while(begin < end){
        ListNode* tmp = new ListNode(*begin);
        tmp->next = 0;
        p->next = tmp;
        p = p->next;
        begin ++;
    }
    p = head;
    head = head->next;
    delete p;
    return head;
}
void freelistNode(ListNode *head){
    while(head){
        ListNode* p = head->next;
        delete head;
        head = p;
    }

}







class Solution {
public:
    ListNode* sortList(ListNode* head) {
            if(head == NULL)
                return head;
            if(head->next == NULL)
                return head;
            ListNode* begin = head;
            ListNode* end = head;


            while(end->next){
                end = end->next;
            }
            vector<ListNode*> res = sortListPartion(begin,end);
            if(res.empty())
                return 0;
            return res[0];
    }
    vector<ListNode *> sortListPartion(ListNode* begin,ListNode* end){

            vector<ListNode *> res;
            //no node
            if(begin == NULL || end == NULL)
                return res;
            //one node
            if(begin == end){
                res.push_back(end);
                res.push_back(begin);
                return res;
            }

            //two nodes
            if(begin->next == end){
                int bval = begin->val;
                int eval = end->val;
                if(bval > eval){
                    begin->val = eval;
                    end->val = bval;
                }
                res.push_back(begin);
                res.push_back(end);
                return res;
            }
            //others
            ListNode* h1 = new ListNode(-1);
            ListNode* h2 = new ListNode(-2);
            ListNode* p =h1,*q= h2;
            ListNode* mid = begin;
            begin = begin->next;
            mid->next = 0;
            int midval = mid->val;
            ListNode* tmp = 0;
            while(begin&&begin != end){
                int bval = begin->val;
                if(bval <= midval){
                    p->next = begin;
                    begin = begin->next;
                    p = p->next;
                    p->next = 0;
                }else{
                    q->next = begin;
                    begin = begin->next;
                    q = q->next;
                    q ->next = 0;
                }

            }



            int bval = begin->val;
            if(bval <= midval){
                p->next = begin;
                begin = begin->next;
                p = p->next;
                p->next = 0;
            }
            else{
                q->next = begin;
                begin = begin->next;
                q = q->next;
                q ->next = 0;
            }

            ListNode* begin1 = h1->next;
//            ListNode* end1 = p;
            ListNode* begin2 = h2->next;
//            ListNode* end2 = q;

            h1->next = 0;
            h2->next = 0;
            delete h1;
            delete h2;


//            //left
            vector<ListNode*> left = sortListPartion(begin1,p);

            if(!left.empty()){
                begin = left[0];
                left[1]->next = mid;
            }else
                begin = mid;

            //right
            vector<ListNode*> right = sortListPartion(begin2,q);
            if(!right.empty()){
                mid->next = right[0];
                end = right[1];
            }else
                end = mid;
            res.push_back(begin);
            res.push_back(end);
            return res;
    }
};

